function Show(props) {
  return <p>{props.id}</p>;
}

export async function getStaticProps({ params }) {
  return {
    props: params,
  };
}
export async function getStaticPaths() {
  const data = [
    {
      id: "1",
      title: "one",
    },
    {
      id: "2",
      title: "two",
    },
  ];

  return {
    paths: [
      {
        id: "1",
      },
      {
        id: "2",
      },
    ],
    fallback: false,
  };
}

export default Show;
